(2, 2, 'Tổng quan nhà xưởng', '- Tường, vật dụng lắp trên tường: Sạch sẽ, gọn gàng\r\n- Nền xưởng: Khu vực làm việc sạch sẽ, đồ vật/pallet trên nền xưởng đã được sắp xếp gọn gàng và đặt đúng vị trí. (Định vị - Định lượng)\r\n- Mỗi khu vực nhà xưởng phải chia trách nhiệm quản lý 5S', 6, '2018-11-05 06:25:39', '2018-11-05 06:25:39'),
(3, 3, 'Tổng quan tại nơi thao tác', '- Khu vực quản lý/làm việc của từng thành viên được sạch sẽ\r\n- Vật dụng tại vị trí thao tác của từng thành viên được sắp xếp, đặt/để đúng vị trí (Định vị - Định tính - Định lượng)', 6, '2018-11-05 06:27:52', '2018-11-05 06:27:52'),
(10, 4, 'Thiết bị', '- Bụi bẩn hàng ngày phải được vệ sinh sạch, không tích tụ thành bụi lâu ngày\r\n- 100% khiếm khuyết được nhận diện và treo thẻ (Theo kiến thức Bảo trì đã hướng dẫn: Qua OPL và thực tế)\r\n- Thông tin trên thẻ treo được ghi đầy đủ, rõ ràng\r\n- Tiến độ xử lý khiếm khuyết/tìm thấy ít nhất 80%', 6, '2018-11-05 06:42:47', '2018-11-05 06:42:47'),
(12, 5, 'Tất cả các thành viên đều tham gia vào hoạt động 5S', 'Khảo sát ngẫu nhiên 1 hoặc 2 thành viên của nhóm, yêu cầu giải thích: Kiến thức về 5S/các hoạt động 5S/mức độ tham gia và các vấn đề của dây chuyền/nhóm gặp phải trong tuần vừa qua và kế hoạch tuần kế tiếp', 6, '2018-11-05 06:44:48', '2018-11-05 06:44:48'),
(13, 1, 'Thông tin hoạt động 5S của nhóm', '- Hình 5S trước/sau, đánh giá 5S mỗi tuần luôn cập nhật đầy đủ trên bảng SOP\r\n- Các form và bảng treo khiếm khuyết luôn được cập nhật đầy đủ và kịp thời\r\n- Thông tin 5S phải được chia sẻ cho toàn bộ thành viên kịp thời', 6, '2018-11-12 03:14:07', '2018-11-12 03:14:07'),
(14, 1, 'Thông tin hoạt động 5S của nhóm', '- Form Đánh giá 5S và các actions được cập nhật và chia sẻ cho toàn bộ thành viên trong nhóm Bảo trì', 8, '2018-11-12 03:18:37', '2018-11-12 03:18:37');
